private UserDo getUser(Serializable id) {
        Long userId = Long.parseLong(id + "");
        String key = UserCacheKey.userInfo(userId);
        String jsonStr = redisUserCache.getStringValue(key);
        if (StringUtils.isBlank(jsonStr)) {
            UserDo user = newsUserMapper.selectUserByUserId(userId);
            if (user != null) {
                if (user.getInviteCode() == null) {
                    String inviteCode = initUserInviteCode(userId);
                    user.setInviteCode(inviteCode);
                }
                AvatarUtil.handleAvatar(user, imageHost, user.getAvatar());
                String userStr = BeanStringUtil.beanToString(user);
                redisUserCache.setStringValue(key, userStr, 3, TimeUnit.DAYS);
            }
            return user;
        }
        try {
            return BeanStringUtil.stringToBean(jsonStr, UserDo.class);
        } catch (Exception e) {
            UserDo user = newsUserMapper.selectByPrimaryKey(id);
            if (user != null) {
                AvatarUtil.handleAvatar(user, imageHost, user.getAvatar());
                String userStr = BeanStringUtil.beanToString(user);
                redisUserCache.setStringValue(key, userStr, 3, TimeUnit.DAYS);
            }
            return user;
        }}
    }

